import React from 'react'
import styled from 'styled-components'
import img1 from './ursula-marvel.jpg'

const Header = () => (<>
<Container>
    <Element>
        <ShortCut>Login/Register</ShortCut>
        <Logo>
            <img src={img1}/>
        </Logo>
        <Search><h1>Cofin Blog</h1></Search>
    </Element>
</Container>
</>)
export default Header;


const Layout =styled.div`
margin: 0 auto;
display: flex;
width:100%;
flex-flow:row wrap;
`

const Container = styled.div`
align=center;
padding: 4em;
color:papayawhip;
`

const Element = styled.div`
margin: 0 auto;
width: 100%;
height: 100px;
display: flex;
flex-flow: row wrap;
`

const ShortCut = styled.div`
order:1;
width:100%;
height: 20px;
text-align: right;
background-color: palevioletred;
`

const Logo = styled.div`
order:2;
width: 200px;
height: 80px;
`

const Search = styled.div`
order:3;
width:880px;
background-color:#fff;
text-align:center;
`
